INSERT INTO `uat_keywords` VALUES ('1250', '10', '1', 'Press Key', null, '*DEPRECATED in SeleniumLibrary 4.0.* use `Press Keys` instead.', '<p><b>DEPRECATED in SeleniumLibrary 4.0.</b> use <a href=\"#Press%20Keys\" class=\"name\">Press Keys</a> instead.</p>', '[\"locator\", \"key\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1251', '10', '0', 'Press Keys', null, 'Simulates the user pressing key(s) to an element or on the active browser.', '<p>Simulates the user pressing key(s) to an element or on the active browser.</p>\n<p>If <code>locator</code> evaluates as False, see <a href=\"#Boolean%20arguments\" class=\"name\">Boolean arguments</a> for more details, then the <code>keys</code> are sent to the currently active browser. Otherwise element is searched and <code>keys</code> are send to the element identified by the <code>locator</code>. In later case, keyword fails if element is not found. See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p><code>keys</code> arguments can contain one or many strings, but it can not be empty. <code>keys</code> can also be a combination of <a href=\"https://seleniumhq.github.io/selenium/docs/api/py/webdriver/selenium.webdriver.common.keys.html\">Selenium Keys</a> and strings or a single Selenium Key. If Selenium Key is combined with strings, Selenium key and strings must be separated by the <span class=\"name\">+</span> character, like in <span class=\"name\">CONTROL+c</span>. Selenium Keys are space and case sensitive and Selenium Keys are not parsed inside of the string. Example AALTO, would send string <span class=\"name\">AALTO</span> and <span class=\"name\">ALT</span> not parsed inside of the string. But <span class=\"name\">A+ALT+O</span> would found Selenium ALT key from the <code>keys</code> argument. It also possible to press many Selenium Keys down at the same time, example \'ALT+ARROW_DOWN`.</p>\n<p>If Selenium Keys are detected in the <code>keys</code> argument, keyword will press the Selenium Key down, send the strings and then release the Selenium Key. If keyword needs to send a Selenium Key as a string, then each character must be separated with <span class=\"name\">+</span> character, example <span class=\"name\">E+N+D</span>.</p>\n<p><span class=\"name\">CTRL</span> is alias for <a href=\"https://seleniumhq.github.io/selenium/docs/api/py/webdriver/selenium.webdriver.common.keys.html#selenium.webdriver.common.keys.Keys.CONTROL\">Selenium CONTROL</a> and ESC is alias for <a href=\"https://seleniumhq.github.io/selenium/docs/api/py/webdriver/selenium.webdriver.common.keys.html#selenium.webdriver.common.keys.Keys.ESCAPE\">Selenium ESCAPE</a></p>\n<p>New in SeleniumLibrary 3.3</p>\n<p>Examples:</p>\n<table border=\"1\">\n<tr>\n<td><a href=\"#Press%20Keys\" class=\"name\">Press Keys</a></td>\n<td>text_field</td>\n<td>AAAAA</td>\n<td></td>\n<td># Sends string \"AAAAA\" to element.</td>\n</tr>\n<tr>\n<td><a href=\"#Press%20Keys\" class=\"name\">Press Keys</a></td>\n<td>None</td>\n<td>BBBBB</td>\n<td></td>\n<td># Sends string \"BBBBB\" to currently active browser.</td>\n</tr>\n<tr>\n<td><a href=\"#Press%20Keys\" class=\"name\">Press Keys</a></td>\n<td>text_field</td>\n<td>E+N+D</td>\n<td></td>\n<td># Sends string \"END\" to element.</td>\n</tr>\n<tr>\n<td><a href=\"#Press%20Keys\" class=\"name\">Press Keys</a></td>\n<td>text_field</td>\n<td>XXX</td>\n<td>YY</td>\n<td># Sends strings \"XXX\" and \"YY\" to element.</td>\n</tr>\n<tr>\n<td><a href=\"#Press%20Keys\" class=\"name\">Press Keys</a></td>\n<td>text_field</td>\n<td>XXX+YY</td>\n<td></td>\n<td># Same as above.</td>\n</tr>\n<tr>\n<td><a href=\"#Press%20Keys\" class=\"name\">Press Keys</a></td>\n<td>text_field</td>\n<td>ALT+ARROW_DOWN</td>\n<td></td>\n<td># Pressing \"ALT\" key down, then pressing ARROW_DOWN and then releasing both keys.</td>\n</tr>\n<tr>\n<td><a href=\"#Press%20Keys\" class=\"name\">Press Keys</a></td>\n<td>text_field</td>\n<td>ALT</td>\n<td>ARROW_DOWN</td>\n<td># Pressing \"ALT\" key and then pressing ARROW_DOWN.</td>\n</tr>\n<tr>\n<td><a href=\"#Press%20Keys\" class=\"name\">Press Keys</a></td>\n<td>text_field</td>\n<td>CTRL+c</td>\n<td></td>\n<td># Pressing CTRL key down, sends string \"c\" and then releases CTRL key.</td>\n</tr>\n<tr>\n<td><a href=\"#Press%20Keys\" class=\"name\">Press Keys</a></td>\n<td>button</td>\n<td>RETURN</td>\n<td></td>\n<td># Pressing \"ENTER\" key to element.</td>\n</tr>\n</table>', '[\"locator=None\", \"*keys\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1252', '10', '0', 'Radio Button Should Be Set To', null, 'Verifies radio button group ``group_name`` is set to ``value``.', '<p>Verifies radio button group <code>group_name</code> is set to <code>value</code>.</p>\n<p><code>group_name</code> is the <code>name</code> of the radio button group.</p>', '[\"group_name\", \"value\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1253', '10', '0', 'Radio Button Should Not Be Selected', null, 'Verifies radio button group ``group_name`` has no selection.', '<p>Verifies radio button group <code>group_name</code> has no selection.</p>\n<p><code>group_name</code> is the <code>name</code> of the radio button group.</p>', '[\"group_name\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1254', '10', '0', 'Register Keyword To Run On Failure', null, 'Sets the keyword to execute, when a SeleniumLibrary keyword fails.', '<p>Sets the keyword to execute, when a SeleniumLibrary keyword fails.</p>\n<p><code>keyword</code> is the name of a keyword that will be executed if a SeleniumLibrary keyword fails. It is possible to use any available keyword, including user keywords or keywords from other libraries, but the keyword must not take any arguments.</p>\n<p>The initial keyword to use is set when <a href=\"#Importing\" class=\"name\">importing</a> the library, and the keyword that is used by default is <a href=\"#Capture%20Page%20Screenshot\" class=\"name\">Capture Page Screenshot</a>. Taking a screenshot when something failed is a very useful feature, but notice that it can slow down the execution.</p>\n<p>It is possible to use string <code>NOTHING</code> or <code>NONE</code>, case-insensitively, as well as Python <code>None</code> to disable this feature altogether.</p>\n<p>This keyword returns the name of the previously registered failure keyword or Python <code>None</code> if this functionality was previously disabled. The return value can be always used to restore the original value later.</p>\n<p>Example:</p>\n<table border=\"1\">\n<tr>\n<td><a href=\"#Register%20Keyword%20To%20Run%20On%20Failure\" class=\"name\">Register Keyword To Run On Failure</a></td>\n<td>Log Source</td>\n<td></td>\n</tr>\n<tr>\n<td>${previous kw}=</td>\n<td><a href=\"#Register%20Keyword%20To%20Run%20On%20Failure\" class=\"name\">Register Keyword To Run On Failure</a></td>\n<td>NONE</td>\n</tr>\n<tr>\n<td><a href=\"#Register%20Keyword%20To%20Run%20On%20Failure\" class=\"name\">Register Keyword To Run On Failure</a></td>\n<td>${previous kw}</td>\n<td></td>\n</tr>\n</table>\n<p>Changes in SeleniumLibrary 3.0:</p>\n<ul>\n<li>Possible to use string <code>NONE</code> or Python <code>None</code> to disable the functionality.</li>\n<li>Return Python <code>None</code> when the functionality was disabled earlier. In previous versions special value <code>No Keyword</code> was returned and it could not be used to restore the original state.</li>\n</ul>', '[\"keyword\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1255', '10', '0', 'Reload Page', null, 'Simulates user reloading page.', '<p>Simulates user reloading page.</p>', '[]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1256', '10', '0', 'Remove Location Strategy', null, 'Removes a previously added custom location strategy.', '<p>Removes a previously added custom location strategy.</p>\n<p>See <a href=\"#Custom%20locators\" class=\"name\">Custom locators</a> for information on how to create and use custom strategies.</p>', '[\"strategy_name\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1257', '10', '1', 'Scroll Element Into View', null, 'Scrolls the element identified by ``locator`` into view.', '<p>Scrolls the element identified by <code>locator</code> into view.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p>New in SeleniumLibrary 3.2.0</p>', '[\"locator\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1258', '10', '1', 'Select All From List', null, 'Selects all options from multi-selection list ``locator``.', '<p>Selects all options from multi-selection list <code>locator</code>.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>', '[\"locator\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1259', '10', '1', 'Select Checkbox', null, 'Selects the checkbox identified by ``locator``.', '<p>Selects the checkbox identified by <code>locator</code>.</p>\n<p>Does nothing if checkbox is already selected.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>', '[\"locator\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1260', '10', '1', 'Select Frame', null, 'Sets frame identified by ``locator`` as the current frame.', '<p>Sets frame identified by <code>locator</code> as the current frame.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p>Works both with frames and iframes. Use <a href=\"#Unselect%20Frame\" class=\"name\">Unselect Frame</a> to cancel the frame selection and return to the main frame.</p>\n<p>Example:</p>\n<table border=\"1\">\n<tr>\n<td><a href=\"#Select%20Frame\" class=\"name\">Select Frame</a></td>\n<td>top-frame</td>\n<td># Select frame with id or name \'top-frame\'</td>\n</tr>\n<tr>\n<td><a href=\"#Click%20Link\" class=\"name\">Click Link</a></td>\n<td>example</td>\n<td># Click link \'example\' in the selected frame</td>\n</tr>\n<tr>\n<td><a href=\"#Unselect%20Frame\" class=\"name\">Unselect Frame</a></td>\n<td></td>\n<td># Back to main frame.</td>\n</tr>\n<tr>\n<td><a href=\"#Select%20Frame\" class=\"name\">Select Frame</a></td>\n<td>//iframe[@name=\'xxx\']</td>\n<td># Select frame using xpath</td>\n</tr>\n</table>', '[\"locator\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1261', '10', '1', 'Select From List By Index', null, 'Selects options from selection list ``locator`` by ``indexes``.', '<p>Selects options from selection list <code>locator</code> by <code>indexes</code>.</p>\n<p>Indexes of list options start from 0.</p>\n<p>If more than one option is given for a single-selection list, the last value will be selected. With multi-selection lists all specified options are selected, but possible old selections are not cleared.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>', '[\"locator\", \"*indexes\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1262', '10', '1', 'Select From List By Label', null, 'Selects options from selection list ``locator`` by ``labels``.', '<p>Selects options from selection list <code>locator</code> by <code>labels</code>.</p>\n<p>If more than one option is given for a single-selection list, the last value will be selected. With multi-selection lists all specified options are selected, but possible old selections are not cleared.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>', '[\"locator\", \"*labels\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1263', '10', '1', 'Select From List By Value', null, 'Selects options from selection list ``locator`` by ``values``.', '<p>Selects options from selection list <code>locator</code> by <code>values</code>.</p>\n<p>If more than one option is given for a single-selection list, the last value will be selected. With multi-selection lists all specified options are selected, but possible old selections are not cleared.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>', '[\"locator\", \"*values\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1264', '10', '0', 'Select Radio Button', null, 'Sets the radio button group ``group_name`` to ``value``.', '<p>Sets the radio button group <code>group_name</code> to <code>value</code>.</p>\n<p>The radio button to be selected is located by two arguments:</p>\n<ul>\n<li><code>group_name</code> is the name of the radio button group.</li>\n<li><code>value</code> is the <code>id</code> or <code>value</code> attribute of the actual radio button.</li>\n</ul>\n<p>Examples:</p>\n<table border=\"1\">\n<tr>\n<td><a href=\"#Select%20Radio%20Button\" class=\"name\">Select Radio Button</a></td>\n<td>size</td>\n<td>XL</td>\n</tr>\n<tr>\n<td><a href=\"#Select%20Radio%20Button\" class=\"name\">Select Radio Button</a></td>\n<td>contact</td>\n<td>email</td>\n</tr>\n</table>', '[\"group_name\", \"value\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1265', '10', '0', 'Select Window', null, 'DEPRECATED in SeleniumLibrary 4.0. , use `Switch Window` instead.', '<p>DEPRECATED in SeleniumLibrary 4.0. , use <a href=\"#Switch%20Window\" class=\"name\">Switch Window</a> instead.</p>', '[\"locator=MAIN\", \"timeout=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1266', '10', '0', 'Set Browser Implicit Wait', null, 'Sets the implicit wait value used by Selenium.', '<p>Sets the implicit wait value used by Selenium.</p>\n<p>Same as <a href=\"#Set%20Selenium%20Implicit%20Wait\" class=\"name\">Set Selenium Implicit Wait</a> but only affects the current browser.</p>', '[\"value\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1267', '10', '1', 'Set Focus To Element', null, 'Sets the focus to the element identified by ``locator``.', '<p>Sets the focus to the element identified by <code>locator</code>.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p>Prior to SeleniumLibrary 3.0 this keyword was named <span class=\"name\">Focus</span>.</p>', '[\"locator\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1268', '10', '0', 'Set Screenshot Directory', null, 'Sets the directory for captured screenshots.', '<p>Sets the directory for captured screenshots.</p>\n<p><code>path</code> argument specifies the absolute path to a directory where the screenshots should be written to. If the directory does not exist, it will be created. The directory can also be set when <a href=\"#Importing\" class=\"name\">importing</a> the library. If it is not configured anywhere, screenshots are saved to the same directory where Robot Framework\'s log file is written.</p>\n<p>The previous value is returned and can be used to restore the original value later if needed.</p>\n<p>Returning the previous value is new in SeleniumLibrary 3.0. The persist argument was removed in SeleniumLibrary 3.2.</p>', '[\"path\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1269', '10', '0', 'Set Selenium Implicit Wait', null, 'Sets the implicit wait value used by Selenium.', '<p>Sets the implicit wait value used by Selenium.</p>\n<p>The value can be given as a number that is considered to be seconds or as a human-readable string like <code>1 second</code>. The previous value is returned and can be used to restore the original value later if needed.</p>\n<p>This keyword sets the implicit wait for all opened browsers. Use <a href=\"#Set%20Browser%20Implicit%20Wait\" class=\"name\">Set Browser Implicit Wait</a> to set it only to the current browser.</p>\n<p>See the <a href=\"#Implicit%20wait\" class=\"name\">Implicit wait</a> section above for more information.</p>\n<p>Example:</p>\n<table border=\"1\">\n<tr>\n<td>${orig wait} =</td>\n<td><a href=\"#Set%20Selenium%20Implicit%20Wait\" class=\"name\">Set Selenium Implicit Wait</a></td>\n<td>10 seconds</td>\n</tr>\n<tr>\n<td><span class=\"name\">Perform AJAX call that is slow</span></td>\n<td></td>\n<td></td>\n</tr>\n<tr>\n<td><a href=\"#Set%20Selenium%20Implicit%20Wait\" class=\"name\">Set Selenium Implicit Wait</a></td>\n<td>${orig wait}</td>\n<td></td>\n</tr>\n</table>', '[\"value\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1270', '10', '0', 'Set Selenium Speed', null, 'Sets the delay that is waited after each Selenium command.', '<p>Sets the delay that is waited after each Selenium command.</p>\n<p>The value can be given as a number that is considered to be seconds or as a human-readable string like <code>1 second</code>. The previous value is returned and can be used to restore the original value later if needed.</p>\n<p>See the <a href=\"#Selenium%20speed\" class=\"name\">Selenium Speed</a> section above for more information.</p>\n<p>Example:</p>\n<table border=\"1\">\n<tr>\n<td><a href=\"#Set%20Selenium%20Speed\" class=\"name\">Set Selenium Speed</a></td>\n<td>0.5 seconds</td>\n</tr>\n</table>', '[\"value\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1271', '10', '0', 'Set Selenium Timeout', null, 'Sets the timeout that is used by various keywords.', '<p>Sets the timeout that is used by various keywords.</p>\n<p>The value can be given as a number that is considered to be seconds or as a human-readable string like <code>1 second</code>. The previous value is returned and can be used to restore the original value later if needed.</p>\n<p>See the <a href=\"#Timeout\" class=\"name\">Timeout</a> section above for more information.</p>\n<p>Example:</p>\n<table border=\"1\">\n<tr>\n<td>${orig timeout} =</td>\n<td><a href=\"#Set%20Selenium%20Timeout\" class=\"name\">Set Selenium Timeout</a></td>\n<td>15 seconds</td>\n</tr>\n<tr>\n<td><span class=\"name\">Open page that loads slowly</span></td>\n<td></td>\n<td></td>\n</tr>\n<tr>\n<td><a href=\"#Set%20Selenium%20Timeout\" class=\"name\">Set Selenium Timeout</a></td>\n<td>${orig timeout}</td>\n<td></td>\n</tr>\n</table>', '[\"value\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1272', '10', '0', 'Set Window Position', null, 'Sets window position using ``x`` and ``y`` coordinates.', '<p>Sets window position using <code>x</code> and <code>y</code> coordinates.</p>\n<p>The position is relative to the top left corner of the screen, but some browsers exclude possible task bar set by the operating system from the calculation. The actual position may thus be different with different browsers.</p>\n<p>Values can be given using strings containing numbers or by using actual numbers. See also <a href=\"#Get%20Window%20Position\" class=\"name\">Get Window Position</a>.</p>\n<p>Example:</p>\n<table border=\"1\">\n<tr>\n<td><a href=\"#Set%20Window%20Position\" class=\"name\">Set Window Position</a></td>\n<td>100</td>\n<td>200</td>\n</tr>\n</table>', '[\"x\", \"y\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1273', '10', '0', 'Set Window Size', null, 'Sets current windows size to given ``width`` and ``height``.', '<p>Sets current windows size to given <code>width</code> and <code>height</code>.</p>\n<p>Values can be given using strings containing numbers or by using actual numbers. See also <a href=\"#Get%20Window%20Size\" class=\"name\">Get Window Size</a>.</p>\n<p>Browsers have a limit on their minimum size. Trying to set them smaller will cause the actual size to be bigger than the requested size.</p>\n<p>If <code>inner</code> parameter is set to True, keyword sets the necessary window width and height to have the desired HTML DOM <i>window.innerWidth</i> and <i>window.innerHeight</i>. See <a href=\"#Boolean%20arguments\" class=\"name\">Boolean arguments</a> for more details on how to set boolean arguments.</p>\n<p>The <code>inner</code> argument is new since SeleniumLibrary 4.0.</p>\n<p>This <code>inner</code> argument does not support Frames. If a frame is selected, switch to default before running this.</p>\n<p>Example:</p>\n<table border=\"1\">\n<tr>\n<td><a href=\"#Set%20Window%20Size\" class=\"name\">Set Window Size</a></td>\n<td>800</td>\n<td>600</td>\n<td></td>\n</tr>\n<tr>\n<td><a href=\"#Set%20Window%20Size\" class=\"name\">Set Window Size</a></td>\n<td>800</td>\n<td>600</td>\n<td>True</td>\n</tr>\n</table>', '[\"width\", \"height\", \"inner=False\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1274', '10', '1', 'Simulate Event', null, 'Simulates ``event`` on the element identified by ``locator``.', '<p>Simulates <code>event</code> on the element identified by <code>locator</code>.</p>\n<p>This keyword is useful if element has <code>OnEvent</code> handler that needs to be explicitly invoked.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p>Prior to SeleniumLibrary 3.0 this keyword was named <span class=\"name\">Simulate</span>.</p>', '[\"locator\", \"event\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1275', '10', '0', 'Submit Form', null, 'Submits a form identified by ``locator``.', '<p>Submits a form identified by <code>locator</code>.</p>\n<p>If <code>locator</code> is not given, first form on the page is submitted.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>', '[\"locator=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1276', '10', '0', 'Switch Browser', null, 'Switches between active browsers using ``index_or_alias``.', '<p>Switches between active browsers using <code>index_or_alias</code>.</p>\n<p>Indices are returned by the <a href=\"#Open%20Browser\" class=\"name\">Open Browser</a> keyword and aliases can be given to it explicitly. Indices start from 1.</p>\n<p>Example:</p>\n<table border=\"1\">\n<tr>\n<td><a href=\"#Open%20Browser\" class=\"name\">Open Browser</a></td>\n<td><a href=\"http://google.com\">http://google.com</a></td>\n<td>ff</td>\n<td></td>\n</tr>\n<tr>\n<td><a href=\"#Location%20Should%20Be\" class=\"name\">Location Should Be</a></td>\n<td><a href=\"http://google.com\">http://google.com</a></td>\n<td></td>\n<td></td>\n</tr>\n<tr>\n<td><a href=\"#Open%20Browser\" class=\"name\">Open Browser</a></td>\n<td><a href=\"http://yahoo.com\">http://yahoo.com</a></td>\n<td>ie</td>\n<td>alias=second</td>\n</tr>\n<tr>\n<td><a href=\"#Location%20Should%20Be\" class=\"name\">Location Should Be</a></td>\n<td><a href=\"http://yahoo.com\">http://yahoo.com</a></td>\n<td></td>\n<td></td>\n</tr>\n<tr>\n<td><a href=\"#Switch%20Browser\" class=\"name\">Switch Browser</a></td>\n<td>1</td>\n<td># index</td>\n<td></td>\n</tr>\n<tr>\n<td><a href=\"#Page%20Should%20Contain\" class=\"name\">Page Should Contain</a></td>\n<td>I\'m feeling lucky</td>\n<td></td>\n<td></td>\n</tr>\n<tr>\n<td><a href=\"#Switch%20Browser\" class=\"name\">Switch Browser</a></td>\n<td>second</td>\n<td># alias</td>\n<td></td>\n</tr>\n<tr>\n<td><a href=\"#Page%20Should%20Contain\" class=\"name\">Page Should Contain</a></td>\n<td>More Yahoo!</td>\n<td></td>\n<td></td>\n</tr>\n<tr>\n<td><a href=\"#Close%20All%20Browsers\" class=\"name\">Close All Browsers</a></td>\n<td></td>\n<td></td>\n<td></td>\n</tr>\n</table>\n<p>Above example expects that there was no other open browsers when opening the first one because it used index <code>1</code> when switching to it later. If you are not sure about that, you can store the index into a variable as below.</p>\n<table border=\"1\">\n<tr>\n<td>${index} =</td>\n<td><a href=\"#Open%20Browser\" class=\"name\">Open Browser</a></td>\n<td><a href=\"http://google.com\">http://google.com</a></td>\n</tr>\n<tr>\n<td># Do something ...</td>\n<td></td>\n<td></td>\n</tr>\n<tr>\n<td><a href=\"#Switch%20Browser\" class=\"name\">Switch Browser</a></td>\n<td>${index}</td>\n<td></td>\n</tr>\n</table>', '[\"index_or_alias\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1277', '10', '0', 'Switch Window', null, 'Switches to browser window matching ``locator``.', '<p>Switches to browser window matching <code>locator</code>.</p>\n<p>If the window is found, all subsequent commands use the selected window, until this keyword is used again. If the window is not found, this keyword fails. The previous windows handle is returned and can be used to switch back to it later.</p>\n<p>Notice that alerts should be handled with <a href=\"#Handle%20Alert\" class=\"name\">Handle Alert</a> or other alert related keywords.</p>\n<p>The <code>locator</code> can be specified using different strategies somewhat similarly as when <a href=\"#Locating%20elements\" class=\"name\">locating elements</a> on pages.</p>\n<ul>\n<li>By default, the <code>locator</code> is matched against window handle, name, title, and URL. Matching is done in that order and the first matching window is selected.</li>\n</ul>\n<ul>\n<li>The <code>locator</code> can specify an explicit strategy by using the format <code>strategy:value</code> (recommended) or <code>strategy=value</code>. Supported strategies are <code>name</code>, <code>title</code>, and <code>url</code>. These matches windows using their name, title, or URL, respectively. Additionally, <code>default</code> can be used to explicitly use the default strategy explained above.</li>\n</ul>\n<ul>\n<li>If the <code>locator</code> is <code>NEW</code> (case-insensitive), the latest opened window is selected. It is an error if this is the same as the current window.</li>\n</ul>\n<ul>\n<li>If the <code>locator</code> is <code>MAIN</code> (default, case-insensitive), the main window is selected.</li>\n</ul>\n<ul>\n<li>If the <code>locator</code> is <code>CURRENT</code> (case-insensitive), nothing is done. This effectively just returns the current window handle.</li>\n</ul>\n<ul>\n<li>If the <code>locator</code> is not a string, it is expected to be a list of window handles <i>to exclude</i>. Such a list of excluded windows can be got from <a href=\"#Get%20Window%20Handles\" class=\"name\">Get Window Handles</a> before doing an action that opens a new window.</li>\n</ul>\n<p>The <code>timeout</code> is used to specify how long keyword will poll to select the new window. The <code>timeout</code> is new in SeleniumLibrary 3.2.</p>\n<p>Example:</p>\n<table border=\"1\">\n<tr>\n<td><a href=\"#Click%20Link\" class=\"name\">Click Link</a></td>\n<td>popup1</td>\n<td></td>\n<td># Open new window</td>\n</tr>\n<tr>\n<td><a href=\"#Switch%20Window\" class=\"name\">Switch Window</a></td>\n<td>example</td>\n<td></td>\n<td># Select window using default strategy</td>\n</tr>\n<tr>\n<td><a href=\"#Title%20Should%20Be\" class=\"name\">Title Should Be</a></td>\n<td>Pop-up 1</td>\n<td></td>\n<td></td>\n</tr>\n<tr>\n<td><a href=\"#Click%20Button\" class=\"name\">Click Button</a></td>\n<td>popup2</td>\n<td></td>\n<td># Open another window</td>\n</tr>\n<tr>\n<td>${handle} =</td>\n<td><a href=\"#Switch%20Window\" class=\"name\">Switch Window</a></td>\n<td>NEW</td>\n<td># Select latest opened window</td>\n</tr>\n<tr>\n<td><a href=\"#Title%20Should%20Be\" class=\"name\">Title Should Be</a></td>\n<td>Pop-up 2</td>\n<td></td>\n<td></td>\n</tr>\n<tr>\n<td><a href=\"#Switch%20Window\" class=\"name\">Switch Window</a></td>\n<td>${handle}</td>\n<td></td>\n<td># Select window using handle</td>\n</tr>\n<tr>\n<td><a href=\"#Title%20Should%20Be\" class=\"name\">Title Should Be</a></td>\n<td>Pop-up 1</td>\n<td></td>\n<td></td>\n</tr>\n<tr>\n<td><a href=\"#Switch%20Window\" class=\"name\">Switch Window</a></td>\n<td>MAIN</td>\n<td></td>\n<td># Select the main window</td>\n</tr>\n<tr>\n<td><a href=\"#Title%20Should%20Be\" class=\"name\">Title Should Be</a></td>\n<td>Main</td>\n<td></td>\n<td></td>\n</tr>\n<tr>\n<td>${excludes} =</td>\n<td><a href=\"#Get%20Window%20Handles\" class=\"name\">Get Window Handles</a></td>\n<td></td>\n<td># Get list of current windows</td>\n</tr>\n<tr>\n<td><a href=\"#Click%20Link\" class=\"name\">Click Link</a></td>\n<td>popup3</td>\n<td></td>\n<td># Open one more window</td>\n</tr>\n<tr>\n<td><a href=\"#Switch%20Window\" class=\"name\">Switch Window</a></td>\n<td>${excludes}</td>\n<td></td>\n<td># Select window using excludes</td>\n</tr>\n<tr>\n<td><a href=\"#Title%20Should%20Be\" class=\"name\">Title Should Be</a></td>\n<td>Pop-up 3</td>\n<td></td>\n<td></td>\n</tr>\n</table>\n<p>The <code>browser</code> argument allows with <code>index_or_alias</code> to implicitly switch to a specific browser when switching to a window. See <a href=\"#Switch%20Browser\" class=\"name\">Switch Browser</a></p>\n<ul>\n<li>If the <code>browser</code> is <code>CURRENT</code> (case-insensitive), no other browser is selected.</li>\n</ul>\n<p><b>NOTE:</b></p>\n<ul>\n<li>The <code>strategy:value</code> syntax is only supported by SeleniumLibrary 3.0 and newer.</li>\n<li>Prior to SeleniumLibrary 3.0 matching windows by name, title and URL was case-insensitive.</li>\n<li>Earlier versions supported aliases <code>None</code>, <code>null</code> and the empty string for selecting the main window, and alias <code>self</code> for selecting the current window. Support for these aliases was removed in SeleniumLibrary 3.2.</li>\n</ul>', '[\"locator=MAIN\", \"timeout=None\", \"browser=CURRENT\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1278', '10', '1', 'Table Cell Should Contain', null, 'Verifies table cell contains text ``expected``.', '<p>Verifies table cell contains text <code>expected</code>.</p>\n<p>See <a href=\"#Get%20Table%20Cell\" class=\"name\">Get Table Cell</a> that this keyword uses internally for an explanation about accepted arguments.</p>', '[\"locator\", \"row\", \"column\", \"expected\", \"loglevel=TRACE\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1279', '10', '1', 'Table Column Should Contain', null, 'Verifies table column contains text ``expected``.', '<p>Verifies table column contains text <code>expected</code>.</p>\n<p>The table is located using the <code>locator</code> argument and its column found using <code>column</code>. See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p>Column indexes start from 1. It is possible to refer to columns from the end by using negative indexes so that -1 is the last column, -2 is the second last, and so on.</p>\n<p>If a table contains cells that span multiple columns, those merged cells count as a single column.</p>\n<p>See <a href=\"#Page%20Should%20Contain%20Element\" class=\"name\">Page Should Contain Element</a> for an explanation about the <code>loglevel</code> argument.</p>', '[\"locator\", \"column\", \"expected\", \"loglevel=TRACE\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1280', '10', '1', 'Table Footer Should Contain', null, 'Verifies table footer contains text ``expected``.', '<p>Verifies table footer contains text <code>expected</code>.</p>\n<p>Any <code>&lt;td&gt;</code> element inside <code>&lt;tfoot&gt;</code> element is considered to be part of the footer.</p>\n<p>The table is located using the <code>locator</code> argument. See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p>See <a href=\"#Page%20Should%20Contain%20Element\" class=\"name\">Page Should Contain Element</a> for an explanation about the <code>loglevel</code> argument.</p>', '[\"locator\", \"expected\", \"loglevel=TRACE\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1281', '10', '1', 'Table Header Should Contain', null, 'Verifies table header contains text ``expected``.', '<p>Verifies table header contains text <code>expected</code>.</p>\n<p>Any <code>&lt;th&gt;</code> element anywhere in the table is considered to be part of the header.</p>\n<p>The table is located using the <code>locator</code> argument. See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p>See <a href=\"#Page%20Should%20Contain%20Element\" class=\"name\">Page Should Contain Element</a> for an explanation about the <code>loglevel</code> argument.</p>', '[\"locator\", \"expected\", \"loglevel=TRACE\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1282', '10', '1', 'Table Row Should Contain', null, 'Verifies that table row contains text ``expected``.', '<p>Verifies that table row contains text <code>expected</code>.</p>\n<p>The table is located using the <code>locator</code> argument and its column found using <code>column</code>. See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p>Row indexes start from 1. It is possible to refer to rows from the end by using negative indexes so that -1 is the last row, -2 is the second last, and so on.</p>\n<p>If a table contains cells that span multiple rows, a match only occurs for the uppermost row of those merged cells.</p>\n<p>See <a href=\"#Page%20Should%20Contain%20Element\" class=\"name\">Page Should Contain Element</a> for an explanation about the <code>loglevel</code> argument.</p>', '[\"locator\", \"row\", \"expected\", \"loglevel=TRACE\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1283', '10', '1', 'Table Should Contain', null, 'Verifies table contains text ``expected``.', '<p>Verifies table contains text <code>expected</code>.</p>\n<p>The table is located using the <code>locator</code> argument. See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p>See <a href=\"#Page%20Should%20Contain%20Element\" class=\"name\">Page Should Contain Element</a> for an explanation about the <code>loglevel</code> argument.</p>', '[\"locator\", \"expected\", \"loglevel=TRACE\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1284', '10', '1', 'Textarea Should Contain', null, 'Verifies text area ``locator`` contains text ``expected``.', '<p>Verifies text area <code>locator</code> contains text <code>expected</code>.</p>\n<p><code>message</code> can be used to override default error message.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>', '[\"locator\", \"expected\", \"message=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1285', '10', '1', 'Textarea Value Should Be', null, 'Verifies text area ``locator`` has exactly text ``expected``.', '<p>Verifies text area <code>locator</code> has exactly text <code>expected</code>.</p>\n<p><code>message</code> can be used to override default error message.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>', '[\"locator\", \"expected\", \"message=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1286', '10', '1', 'Textfield Should Contain', null, 'Verifies text field ``locator`` contains text ``expected``.', '<p>Verifies text field <code>locator</code> contains text <code>expected</code>.</p>\n<p><code>message</code> can be used to override the default error message.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>', '[\"locator\", \"expected\", \"message=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1287', '10', '1', 'Textfield Value Should Be', null, 'Verifies text field ``locator`` has exactly text ``expected``.', '<p>Verifies text field <code>locator</code> has exactly text <code>expected</code>.</p>\n<p><code>message</code> can be used to override default error message.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>', '[\"locator\", \"expected\", \"message=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1288', '10', '0', 'Title Should Be', null, 'Verifies that the current page title equals ``title``.', '<p>Verifies that the current page title equals <code>title</code>.</p>\n<p>The <code>message</code> argument can be used to override the default error message.</p>\n<p><code>message</code> argument is new in SeleniumLibrary 3.1.</p>', '[\"title\", \"message=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1289', '10', '1', 'Unselect All From List', null, 'Unselects all options from multi-selection list ``locator``.', '<p>Unselects all options from multi-selection list <code>locator</code>.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p>New in SeleniumLibrary 3.0.</p>', '[\"locator\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1290', '10', '1', 'Unselect Checkbox', null, 'Removes the selection of checkbox identified by ``locator``.', '<p>Removes the selection of checkbox identified by <code>locator</code>.</p>\n<p>Does nothing if the checkbox is not selected.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>', '[\"locator\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1291', '10', '0', 'Unselect Frame', null, 'Sets the main frame as the current frame.', '<p>Sets the main frame as the current frame.</p>\n<p>In practice cancels the previous <a href=\"#Select%20Frame\" class=\"name\">Select Frame</a> call.</p>', '[]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1292', '10', '1', 'Unselect From List By Index', null, 'Unselects options from selection list ``locator`` by ``indexes``.', '<p>Unselects options from selection list <code>locator</code> by <code>indexes</code>.</p>\n<p>Indexes of list options start from 0. This keyword works only with multi-selection lists.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>', '[\"locator\", \"*indexes\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1293', '10', '1', 'Unselect From List By Label', null, 'Unselects options from selection list ``locator`` by ``labels``.', '<p>Unselects options from selection list <code>locator</code> by <code>labels</code>.</p>\n<p>This keyword works only with multi-selection lists.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>', '[\"locator\", \"*labels\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1294', '10', '1', 'Unselect From List By Value', null, 'Unselects options from selection list ``locator`` by ``values``.', '<p>Unselects options from selection list <code>locator</code> by <code>values</code>.</p>\n<p>This keyword works only with multi-selection lists.</p>\n<p>See the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>', '[\"locator\", \"*values\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1295', '10', '0', 'Wait For Condition', null, 'Waits until ``condition`` is True or ``timeout`` expires.', '<p>Waits until <code>condition</code> is True or <code>timeout</code> expires.</p>\n<p>The condition can be arbitrary JavaScript expression but it must return a value to be evaluated. See <a href=\"#Execute%20Javascript\" class=\"name\">Execute JavaScript</a> for information about accessing content on pages.</p>\n<p>Fails if the timeout expires before the condition becomes True. See the <span class=\"name\">Timeouts</span> section for more information about using timeouts and their default value.</p>\n<p><code>error</code> can be used to override the default error message.</p>\n<p>Examples:</p>\n<table border=\"1\">\n<tr>\n<td><a href=\"#Wait%20For%20Condition\" class=\"name\">Wait For Condition</a></td>\n<td>return document.title == \"New Title\"</td>\n</tr>\n<tr>\n<td><a href=\"#Wait%20For%20Condition\" class=\"name\">Wait For Condition</a></td>\n<td>return jQuery.active == 0</td>\n</tr>\n<tr>\n<td><a href=\"#Wait%20For%20Condition\" class=\"name\">Wait For Condition</a></td>\n<td>style = document.querySelector(\'h1\').style; return style.background == \"red\" &amp;&amp; style.color == \"white\"</td>\n</tr>\n</table>', '[\"condition\", \"timeout=None\", \"error=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1296', '10', '1', 'Wait Until Element Contains', null, 'Waits until the element ``locator`` contains ``text``.', '<p>Waits until the element <code>locator</code> contains <code>text</code>.</p>\n<p>Fails if <code>timeout</code> expires before the text appears. See the <span class=\"name\">Timeouts</span> section for more information about using timeouts and their default value and the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p><code>error</code> can be used to override the default error message.</p>', '[\"locator\", \"text\", \"timeout=None\", \"error=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1297', '10', '1', 'Wait Until Element Does Not Contain', null, 'Waits until the element ``locator`` does not contain ``text``.', '<p>Waits until the element <code>locator</code> does not contain <code>text</code>.</p>\n<p>Fails if <code>timeout</code> expires before the text disappears. See the <span class=\"name\">Timeouts</span> section for more information about using timeouts and their default value and the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p><code>error</code> can be used to override the default error message.</p>', '[\"locator\", \"text\", \"timeout=None\", \"error=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1298', '10', '1', 'Wait Until Element Is Enabled', null, 'Waits until the element ``locator`` is enabled.', '<p>Waits until the element <code>locator</code> is enabled.</p>\n<p>Element is considered enabled if it is not disabled nor read-only.</p>\n<p>Fails if <code>timeout</code> expires before the element is enabled. See the <span class=\"name\">Timeouts</span> section for more information about using timeouts and their default value and the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p><code>error</code> can be used to override the default error message.</p>\n<p>Considering read-only elements to be disabled is a new feature in SeleniumLibrary 3.0.</p>', '[\"locator\", \"timeout=None\", \"error=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1299', '10', '1', 'Wait Until Element Is Not Visible', null, 'Waits until the element ``locator`` is not visible.', '<p>Waits until the element <code>locator</code> is not visible.</p>\n<p>Fails if <code>timeout</code> expires before the element is not visible. See the <span class=\"name\">Timeouts</span> section for more information about using timeouts and their default value and the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p><code>error</code> can be used to override the default error message.</p>', '[\"locator\", \"timeout=None\", \"error=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1300', '10', '1', 'Wait Until Element Is Visible', null, 'Waits until the element ``locator`` is visible.', '<p>Waits until the element <code>locator</code> is visible.</p>\n<p>Fails if <code>timeout</code> expires before the element is visible. See the <span class=\"name\">Timeouts</span> section for more information about using timeouts and their default value and the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p><code>error</code> can be used to override the default error message.</p>', '[\"locator\", \"timeout=None\", \"error=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1301', '10', '0', 'Wait Until Location Contains', null, 'Waits until the current URL contains ``expected``.', '<p>Waits until the current URL contains <code>expected</code>.</p>\n<p>The <code>expected</code> argument contains the expected value in url.</p>\n<p>Fails if <code>timeout</code> expires before the location contains. See the <span class=\"name\">Timeouts</span> section for more information about using timeouts and their default value.</p>\n<p>The <code>message</code> argument can be used to override the default error message.</p>\n<p>New in SeleniumLibrary 4.0</p>', '[\"expected\", \"timeout=None\", \"message=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1302', '10', '0', 'Wait Until Location Is', null, 'Waits until the current URL is ``expected``.', '<p>Waits until the current URL is <code>expected</code>.</p>\n<p>The <code>expected</code> argument is the expected value in url.</p>\n<p>Fails if <code>timeout</code> expires before the location is. See the <span class=\"name\">Timeouts</span> section for more information about using timeouts and their default value.</p>\n<p>The <code>message</code> argument can be used to override the default error message.</p>\n<p>New in SeleniumLibrary 4.0</p>', '[\"expected\", \"timeout=None\", \"message=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1303', '10', '0', 'Wait Until Page Contains', null, 'Waits until ``text`` appears on the current page.', '<p>Waits until <code>text</code> appears on the current page.</p>\n<p>Fails if <code>timeout</code> expires before the text appears. See the <span class=\"name\">Timeouts</span> section for more information about using timeouts and their default value.</p>\n<p><code>error</code> can be used to override the default error message.</p>', '[\"text\", \"timeout=None\", \"error=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1304', '10', '1', 'Wait Until Page Contains Element', null, 'Waits until the element ``locator`` appears on the current page.', '<p>Waits until the element <code>locator</code> appears on the current page.</p>\n<p>Fails if <code>timeout</code> expires before the element appears. See the <span class=\"name\">Timeouts</span> section for more information about using timeouts and their default value and the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p><code>error</code> can be used to override the default error message.</p>', '[\"locator\", \"timeout=None\", \"error=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1305', '10', '0', 'Wait Until Page Does Not Contain', null, 'Waits until ``text`` disappears from the current page.', '<p>Waits until <code>text</code> disappears from the current page.</p>\n<p>Fails if <code>timeout</code> expires before the text disappears. See the <span class=\"name\">Timeouts</span> section for more information about using timeouts and their default value.</p>\n<p><code>error</code> can be used to override the default error message.</p>', '[\"text\", \"timeout=None\", \"error=None\"]', '[]', '2020-07-21 18:18:13', null, null);
INSERT INTO `uat_keywords` VALUES ('1306', '10', '1', 'Wait Until Page Does Not Contain Element', null, 'Waits until the element ``locator`` disappears from the current page.', '<p>Waits until the element <code>locator</code> disappears from the current page.</p>\n<p>Fails if <code>timeout</code> expires before the element disappears. See the <span class=\"name\">Timeouts</span> section for more information about using timeouts and their default value and the <a href=\"#Locating%20elements\" class=\"name\">Locating elements</a> section for details about the locator syntax.</p>\n<p><code>error</code> can be used to override the default error message.</p>', '[\"locator\", \"timeout=None\", \"error=None\"]', '[]', '2020-07-21 18:18:13', null, null);

